INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "青空の下で謁見", 7, 0, 5118061, "ペコリーヌとの出会い", 40, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 2, 2834, 10118, "フリーマーケット会場");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "未来の騎空団\nマスコット？", 7, 0, 5118062, "マホとの出会い", 40, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 2, 2835, 10118, "フリーマーケット会場");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "お嬢さまからの\n緊急依頼", 7, 0, 5118063, "アキノとの出会い", 40, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 2, 2837, 10118, "ランドソル市街地");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "黄金色の悩みごと", 18, 0, 5118064, "ジュンとの出会い", 40, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 2, 4108402, 10118, "フリーマーケット会場");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "白熱！　格闘大会！", 18, 0, 5118065, "カオリとの出会い", 40, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 2, 4107402, 10118, "フリーマーケット会場");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "祭り太鼓はオーエドの華", 16, 1, 5118066, "ニノンとの出会い", 40, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 0, 2, 9000227, 10118, "オーエド町");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "人気者は遅れて\nやってくる", 19, 0, 5118067, "スズナとの出会い", 40, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 3, 2101181, 10118, "フリーマーケット会場");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "巫女・ミーツ・魔法少女", 18, 0, 5118068, "ナナカとの出会い", 40, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 3, 4109402, 10118, "ランドソル市街地");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "ネズ耳は二度なくなる", 18, 0, 5118069, "キャル＆コッコロとの出会い", 40, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 3, 4305402, 10118, "フリーマーケット会場");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "この出会いにカンパイ！", 18, 0, 5118070, "ユカリとの出会い", 40, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 3, 4101402, 10118, "ランドソル市街地");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "陰陽アンサンブル", 18, 0, 5118071, "アオイとの出会い", 40, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 3, 4106402, 10118, "ランドソル市街地");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (1, 8, 91002, "運試し十番勝負！", 7, 1, 5118072, "シノブとの出会い", 40, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 0, 3, 2836, 10118, "フリーマーケット会場");
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 0, 0, "彼女たちの新たな日常", 0, 0, 5118600, "オープニング", 0, 0, 10145115, 1, 0, 10118, 0);
